class TodoApp extends PureComponent {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div className="TodoAapp">
        <LoginComponent />
      </div>
    );
  }
}

class LoginComponent extends PureComponent {
  render() {
    return (
      <div>
        User Name: <input type="text" name="ussername" value="rishipatel" />
        Password: <input type="text" name="password" />
        <button>Login</button>
      </div>
    );
  }
}

export default TodoApp;
